import React, { useState, useEffect } from 'react'; 
import axios from 'axios'; 
import 'bootstrap/dist/css/bootstrap.min.css'; 
import { useNavigate } from 'react-router-dom'; 
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

const Logs = () => {   
    const navigate = useNavigate();
    const [logs, setLogs] = useState([]);
    const [chartData, setChartData] = useState(null);
    const [responseTimeData, setResponseTimeData] = useState(null);

    useEffect(() => {
        axios.get("http://localhost:5001/getServer")
            .then(response => {
                if (response.data.logs && response.data.logs.length > 0) {
                    setLogs(response.data.logs);
                    procesarDatos(response.data.logs);
                }
            })
            .catch(error => console.error("Error obteniendo logs: ", error));
    }, []);

    console.log(logs);

    const procesarDatos = (logs) => {
      // Contadores por servidor y categoría
      let cantidadServidor1_info = 0;
      let cantidadServidor1_warn = 0;
      let cantidadServidor1_error = 0;
  
      let cantidadServidor2_info = 0;
      let cantidadServidor2_warn = 0;
      let cantidadServidor2_error = 0;
  
      // Filtramos y clasificamos los logs según su status
      logs.forEach(log => {
          if (log.server === "1" || log.server === 1) {
              if ([200, 201, 204].includes(log.status)) cantidadServidor1_info++;
              else if ([300, 301, 302].includes(log.status)) cantidadServidor1_warn++;
              else if (log.status >= 400) cantidadServidor1_error++;
          }
          if (log.server === "2" || log.server === 2) {
              if ([200, 201, 204].includes(log.status)) cantidadServidor2_info++;
              else if ([300, 301, 302].includes(log.status)) cantidadServidor2_warn++;
              else if (log.status >= 400) cantidadServidor2_error++;
          }
      });
  
      // Mostrar en consola
      console.log("Logs Servidor 1 (info):", cantidadServidor1_info);
      console.log("Logs Servidor 1 (warn):", cantidadServidor1_warn);
      console.log("Logs Servidor 1 (error):", cantidadServidor1_error);
      console.log("Logs Servidor 2 (info):", cantidadServidor2_info);
      console.log("Logs Servidor 2 (warn):", cantidadServidor2_warn);
      console.log("Logs Servidor 2 (error):", cantidadServidor2_error);
  
      // Configurar los datos de la gráfica
      const labels = ["Servidor 1", "Servidor 2"];
      const valoresInfo = [cantidadServidor1_info, cantidadServidor2_info];  // Logs info
      const valoresWarn = [cantidadServidor1_warn, cantidadServidor2_warn];  // Logs warn
      const valoresError = [cantidadServidor1_error, cantidadServidor2_error];  // Logs error
  
      setChartData({
          labels,
          datasets: [
              {
                  label: "Info",
                  data: valoresInfo,
                  backgroundColor: "rgba(54, 162, 235, 0.5)", // Azul
                  borderColor: "rgba(54, 162, 235, 1)",
                  borderWidth: 1,
              },
              {
                  label: "Warn",
                  data: valoresWarn,
                  backgroundColor: "rgba(255, 159, 64, 0.5)", // Naranja
                  borderColor: "rgba(255, 159, 64, 1)",
                  borderWidth: 1,
              },
              {
                  label: "Error",
                  data: valoresError,
                  backgroundColor: "rgba(255, 99, 132, 0.5)", // Rojo
                  borderColor: "rgba(255, 99, 132, 1)",
                  borderWidth: 1,
              }
          ]
      });
  };

  const procesarTiemposRespuesta = (logs) => {
    let servidor1_fast = 0;
    let servidor1_medium = 0;
    let servidor1_slow = 0;

    let servidor2_fast = 0;
    let servidor2_medium = 0;
    let servidor2_slow = 0;

    logs.forEach(log => {
        if (log.server === "1" || log.server === 1) {
            if (log.response_time < 200) servidor1_fast++;
            else if (log.response_time >= 200 && log.response_time <= 500) servidor1_medium++;
            else servidor1_slow++;
        }
        if (log.server === "2" || log.server === 2) {
            if (log.response_time < 200) servidor2_fast++;
            else if (log.response_time >= 200 && log.response_time <= 500) servidor2_medium++;
            else servidor2_slow++;
        }
    });

    const labels = ["Servidor 1", "Servidor 2"];
    const fastData = [servidor1_fast, servidor2_fast];
    const mediumData = [servidor1_medium, servidor2_medium];
    const slowData = [servidor1_slow, servidor2_slow];

    setResponseTimeData({
        labels,
        datasets: [
            {
                label: "Rápido (<200ms)",
                data: fastData,
                backgroundColor: "rgba(75, 192, 192, 0.5)", 
                borderColor: "rgba(75, 192, 192, 1)",
                borderWidth: 1,
            },
            {
                label: "Medio (200-500ms)",
                data: mediumData,
                backgroundColor: "rgba(255, 205, 86, 0.5)", 
                borderColor: "rgba(255, 205, 86, 1)",
                borderWidth: 1,
            },
            {
                label: "Lento (>500ms)",
                data: slowData,
                backgroundColor: "rgba(255, 99, 132, 0.5)", 
                borderColor: "rgba(255, 99, 132, 1)",
                borderWidth: 1,
            }
        ]
    });
};
  

    return (
        <div className="container mt-4" style={{marginTop: '50px', marginBottom: '60px'}}>
            <h3 className="text-center">Logs</h3> 
            <div className="card p-3">
                {chartData ? (
                    <Bar 
                        data={chartData} 
                        options={{
                            responsive: true, 
                            plugins: { 
                                legend: { position: 'top' } 
                            }
                        }} 
                    />
                ) : (
                    <p>Cargando datos...</p>
                )}
            </div>
          <div  style={{textAlign: 'center',position: 'relative'}}>
              <button 
                    className="btn btn-warning mt-3"  
                    type="button" 
                    onClick={() => navigate('/home')}
                >
                    Ver Home
              </button>
          </div>

        </div>
    );
};

export default Logs;
